function nextStep(e){document.getElementById("step"+e).classList.remove("active"),document.getElementById("step"+(e+1)).classList.add("active")}function prevStep(e){document.getElementById("step"+e).classList.remove("active"),document.getElementById("step"+(e-1)).classList.add("active")}function submitForm(e,t){const n=new FormData(e);n.append("g-recaptcha-response",t),fetch(e.action,{method:"POST",body:n}).then((e=>{e.ok?window.location.href="/thank-you.html":alert("Something went wrong. Please try again.")})).catch((()=>{alert("Something went wrong. Please try again.")}))}document.getElementById("multiForm").addEventListener("submit",(function(e){e.preventDefault();const t=e.target,n=document.getElementById("g-recaptcha-response").value;n?submitForm(t,n):setTimeout((()=>{const e=document.getElementById("g-recaptcha-response").value;e?submitForm(t,e):alert("Please complete the reCAPTCHA before submitting.")}),800)}));